import { Routes, Route } from 'react-router-dom';


const App = () => {
  return (
    <>
    <div className="main">
    <Nav/>
    <Routes>
        <Route path="/" element={<Menu/>} />

    </Routes>

    </div>

    </>
  )
}

export default App
